package ra.dev.model.serviceImp;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import ra.dev.model.entity.Cart;import ra.dev.model.repository.CartRepository;import ra.dev.model.service.CartService;import javax.transaction.Transactional;import java.sql.SQLException;import java.util.List;@Service@Transactional(rollbackOn = SQLException.class)public class CartServiceImp implements CartService {    @Autowired    CartRepository cartRepository;    @Override    public List<Cart> findAll() {        return cartRepository.findAll();    }    @Override    public Cart findByID(int cartID) {        return cartRepository.findById(cartID).get();    }    @Override    public Cart saveOrUpdate(Cart cart) {        return cartRepository.save(cart);    }    @Override    public void delete(int cartID) {        cartRepository.deleteById(cartID);    }    @Override    public List<Cart> searchByName(String cart) {        return null;    }    @Override    public List<Cart> searchCartByUserID(int userID) {        return cartRepository.searchCartByUserID(userID);    }}